const Tasks = () => {
    const [tasks, setTasks] = useState([
        {name : "Bob"},
        {name : "Tome"},
        {name : "Jef"},
        {name : "Fred"},
        {name : "Bo"},


    ])
    fetch('http://localhost:8000')
    .then(response => response.json())
    .then(data => setTasks([
        {name : "Bob"},
        {name : "Tome"},
        {name : "Jef"},
        {name : "Fred"},
        {name : "Bo"},


    ]));
    return (
        <div>
            <h1>This is get request: { tasks }</h1>
            {tasks.map((task) => (<h3>{task.name}</h3>))}

        </div>
    )
}

